import axios from "axios";
import { ProductType } from "./type";

const URL_API = 'https://dummyjson.com/products'

//axios.defaults.baseURL = URL_API

export const ProductApi  = {
    async getAll(){
        return await axios.get<ProductType[]>('/products')
    }
}
